import { Component } from "react";

export default class TravelPlans extends Component {
  constructor() {
    super();
  }

  render() {
    return (
      <div>
        <h1>TravelPlans of {this.props.LoggedUser.userName}</h1>
        <img src={this.props.LoggedUser.picture} />
        <h2>{this.props.LoggedUser.Email}</h2>
        <h2>{this.props.LoggedUser.country}</h2>
        <Link to="creatPlan">add new Plan</Link>
      </div>
    );
  }
}
